css:
@-moz-document domain("reddit.com") {
html, body, h1, h2, h3, h4, h5, li, li span, p, a,
.sitetable,
.entry .buttons li a,
.md p,
.morelink a, .morelink a:hover
  {
    font-family: 'Ubuntu',sans-serif;
  }
.s1r1zaa-6,
.s1c2oq5o-6, .eePGjB{
    background-color: rgba(0,0,0,0.8);
}
.s1r1zaa-2:after,
.s1c2oq5o-2:after,
.s3n19jy-0:after,
.eePGjB::after{
    background-color: rgba(0,0,0,0) !important;
}
@font-face {
    font-family: 'Ubuntu';
    src: local('Ubuntu Bold'), local('Ubuntu-Bold'),
        url(data:application/font-woff2;charset=utf-8;base64,) format('woff2');
    font-weight: bold;
    font-style: normal;
}

@font-face {
    font-family: 'Ubuntu';
    src: local('Ubuntu Medium'), local('Ubuntu-Medium'),
        url(data:application/font-woff2;charset=utf-8;base64,) format('woff2');
    font-weight: 500;
    font-style: normal;
}

@font-face {
    font-family: 'Ubuntu';
    src: local('Ubuntu Regular'), local('Ubuntu-Regular'),
        url(data:application/font-woff2;charset=utf-8;base64,) format('woff2');
    font-weight: normal;
    font-style: normal;
}
}
